import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faSearch } from '@fortawesome/free-solid-svg-icons';

const Navbar = () => {
  return (
    <div className='containerStyle' style={{ alignItems: 'center', backgroundColor: 'white' }}>
      <div style={{ color: 'black', textAlign: 'left', backgroundColor: '#5DADE2 ', height: '10vh' }}>
        <h1>Account Management</h1>
        <div style={{ marginLeft: '1100px', }}>
          <p style={{ marginBottom: '5px', color: 'white' }}>Select Language:</p>
          <select>
            <option value="english">English</option>
            <option value="hindi">Hindi</option>
          </select>
        </div>  
        <a className="nav-link" href="" style={{ position: 'absolute', left: 0, top: 0 }}>
          <FontAwesomeIcon icon={faHome} style={{ background: 'none', height: '26px', marginTop: '35px', marginLeft: '1460px' }} />
        </a>
      </div>

      {/* Rest of your code */}
    </div>
  );
};

export default Navbar;
